I successfully completed my first online life modelling session on Sunday!
Although I was nervous at first I relaxed into it. Thank you @deryck.henley for inviting me to participate and for training me in a new (to me) genre of modelling.
I've been pleasantly overwhelmed in the last couple of days with an inundation of artwork from the session popping up on Instagram and Facebook. It's so interesting to see the unique styles and personalities of each artist interpreting their perspective in a visual medium.
~
Follow @scottishborderslifedrawingclub for announcements about the group's upcoming life drawing sessions with models from around the world.
